Absolutely Fabulous is een Britse comedyserie die gaat over een gezin, moeder Eddie Monsoon (Jennifer Saunders) en dochter Saffron (Julia Sawalha), wier rollen wat betreft verantwoordelijkheidsbesef en levenshouding tegengesteld zijn, en andersom dan men gezien het generatieverschil zou verwachten. Daarnaast spelen ook Joanna Lumley, Jane Horrocks en June Whitfield een belangrijke rol in de reeks. De serie werd geregisseerd door Bob Spiers en geproduceerd door Jon Plowman. De scenario's zijn van de hand van Jennifer Saunders. (uit de Nederlandse Wikipedia)

